  summary: Fluent matcher for <xref href="Microsoft.CodeAnalysis.IParameterSymbol" data-throw-if-not-resolved="false"></xref> instances.
  remarks: >-
    <p>
        Provides parameter-specific matching predicates in addition to the common
        symbol matching functionality from <xref href="ANcpLua.Roslyn.Utilities.Matching.SymbolMatcherBase%602" data-throw-if-not-resolved="false"></xref>.
    </p>

    <ul><li>Match by parameter passing mode (ref, out, in).</li><li>Match by parameter modifiers (params, optional).</li><li>Match by parameter type.</li></ul>
